const List = ({todos, deleteTodos}) => {
    const complete = () => {
        deleteTodos()
    }
    return(
        <div>
            {todos.map(todo => {
                return(
                    <div key={todos.id}>
                        <button onClick={() => complete(todo.id)}>完了</button>
                        <span>{todo.content}</span>
                    </div>
                )
            })}
        </div>

    );
}

export default List;
